didad, mientras que el radio del diapasón de 12  y los trastes jumbo son ideales para hacer bendings sin esfuerzo. Las pastillas humbucking cuentan con un sonido fuerte para tus ritmos crujientes y abrasadores solos. Otras características de estilo premium incluyen cubiertas cromadas para las pastillas y una atractiva pala pintada a juego para hacer que esta guitarra destaque en cualquier situación. Con su combinación de estilo Tele atemporal, características centradas en el músico y un tono increíble, la Telecaster HH contemporánea es la guitarra que falta en tu arsenal',33,2,5),(30,'Guitarra Electrica Onas Frizz Bolt On Cuerpo De Roble Blanco',21338,384073,'https://bairesrocks.vteximg.com.br/arquivos/ids/201795-1500-1500/664847-MLA41083725212_032020-F.jpg?v=637313060481230000','Se caracteriza por su exclusivo y propio diseño. Su caracteristico sonido se obtiene desde sus microfonos  Paradynamic y su madera maciza. Este cuerpo totalmente construido de madera solida de la Patagonia, le  proporciona una sonoridad muy rica en armónicos y sustain. El mango construido en maple con trastera de  palo rosa posee un alma de acero que le otorga mayor estabilidad en la calibración y afinación.  A través  de su suave terminación en laca semimate se aprecia la veta real de dicha madera.',17,2,26),(31,'Amplificador Fender Champion 100 Watts De Guitarra Efectos',604082,63956,'https://bairesrocks.vteximg.com.br/arquivos/ids/201688-1500-1500/704359-MLA31490643391_072019-F.jpg?v=637313060113600000','Amplificador de Guitarra - ontroles: Canal 1 Volume, canal 2 Gain, Volume, Voice, Treble, Bass, FX Level, FX Select, Tap Efectos: Reverb, Delay/Echo, Chorus, Tremolo, Vibratone',31,4,25),(32,'Pedal Hartke Hl77 Bass Looper 99 Bancos Memoria 6 Hrs Usb',988,17793,'https://bairesrocks.vteximg.com.br/arquivos/ids/207191-1500-1500/790340-MLA42270890673_062020-F.jpg?v=637313077254800000','\"El Hartke H77 tiene una capacidad de grabación de hasta 6 horas, por lo que se pueden utilizar hasta 99 espacios de almacenamiento para grabaciones. ¡Tan espacio más que suficiente para tus ideas creativas! Sobregrabaciones ilimitadas y 20 ritmos acompañantes en 3/4 y 4/4 tiempo completan hábilmente la amplia gama de funciones. Y para que los jugos creativos también puedan desarrollarse libremente, Hartke atribuyó gran importancia al hecho de que ninguna operación engorrosa destruye la creatividad. \"',9,2,27),(33,'Batería Acústica Pearl Roadshow 22 5 Cuerpos Rs525wfbc/ar',5934,106809,'https://bairesrocks.vteximg.com.br/arquivos/ids/206226-1500-1500/923191-MLA41327874515_042020-F.jpg?v=637313073957200000','El Pearl Roadshow 22’’ Drum Kit es una batería de alta calidad de Pearl, que ofrece todo lo que el baterista de nivel de entrada necesita para comenzar su viaje sin problemas. Los cascos de álamo de 9 capas ofrecen tonos profundos y enfocados con buena resonancia y un ataque potente, lo que hace que los tambores sean perfectos para cualquier estilo. Con platillos, un snare set completo de Herraje un trono de batería, palos y una bolsa de palos, este kit incluye todo lo que necesitas para tu primera batería y mucho más.',11,1,28),(34,'Trompeta Jupiter Bb Pistones De Nickel + Estuche Jtr500',4052,72934,'https://bairesrocks.vteximg.com.br/arquivos/ids/206195-1500-1500/654653-MLA27134825114_042018-F.jpg?v=637313073849670000','Descripcion: - Violin Cremona Profesional 4/4 - Puente, Mentonera y clavijas De Madera - Incluye: *Estuche *Arco *Resina',10,5,29),(35,'Guitarra Eléctrica Jackson Js11 Dinky Tremolo Rw',187462,43441,'https://bairesrocks.vteximg.com.br/arquivos/ids/207260-1500-1500/701974-MLA42419968901_062020-F.jpg?v=637313077482770000','Diseñado para la máxima jugabilidad. El Jackson JS11 Dinky proporciona la plataforma perfecta para solos rápidos y trituración. Deslice sin esfuerzo hacia arriba y hacia abajo el delgado cuello de arce de 1 pieza, gracias a un acabado liso de uretano satinado. El cuello delgado se adapta perfectamente a su mano para que pueda sostener cómodamente su hacha, incluso durante los solos y riffs más rápidos. Cualquier cosa, desde chugs profundos hasta líneas de plomo altísimas, se hace fácil gracias a un diapasón plano de amaranto de 12 `` de radio, lo que permite que su juego fluya sin problemas de nota a nota.',31,2,30),(36,'Mixer Grabacion Mackie 2404-vlz4 Vivo Consola 24 Canales',8497,152939,'https://bairesrocks.vteximg.com.br/arquivos/ids/202958-700-700/755716-MLA27134598437_042018-F.jpg?v=637313063892730000','El Mackie 2404VLZ4 es una consola de mezcla profesional equipada con las herramientas que necesita para llegar a lo mejor de su sonido en vivo, sin necesidad de efecto externo y unidades de procesamiento dinámico. Su calidad de construcción ´´Construido-como-un-tanque´´ hace la 2404VLZ4 una consola resistente al uso cotidíaños y canciones pre-mezcladas listas para sus conciertos, ofreciendo una calidad de audio increíble junto a una sólida fiabilidad.',5,4,31),(37,'Cortina Musical Thunder Jbch-36 Bar Chimes Carrillon De 36 Barras De Bronce Con Soporte',860,15474,'https://bairesrocks.vteximg.com.br/arquivos/ids/207056-700-700/649970-MLA31911033669_082019-F.jpg?v=637313076821330000','Esta cortina, también conocido como carillones de viento y carillones de barras es un diseño bien construido y resonante que puede agregar color a cualquier pieza. Ya sea que se use en una orquesta de bandas de música o simplemente esa pieza adicional para agregar a sus grabaciones de batería, esta cortina agregará ese brillo extra a la música de percusión.',2,1,1),(38,'Guitarra Electrica Yamaha RGX220DZ Gris Oscuro Metalico',4044,72796,'https://bairesrocks.vteximg.com.br/arquivos/ids/221020-700-700/D_NQ_NP_897733-MLA43754661819_102020-O.jpg?v=637395919691600000','La guitarra eléctrica Yamaha RGX220DZ presenta cuerpo de aliso, diapasón de  palosanto y clavijas Die Cast. Posee 24 trastes y puente flotante. Además, cuenta con dos pastillas Humbucker cerámicas. Los imanes cerámicos se utilizan por su mayor potencia y su rango tonal más amplio. Estas pastillas producen una distorsión más clara.',6,2,32),(39,'Redoblante Mapex - Mpx Birch - 14\'\' X 5,5\'\' - ( Mpbc-4550cxn )',1089,44001,'https://d26lpennugtm8s.cloudfront.net/stores/001/166/603/products/34-131-1ae57ad098712535cf15932735727605-640-0.png','Los redoblantes MPX Birch brindan un ataque nítido y brillante, tono equilibrado y un sustain más corto que da como resultado una proyección general mejorada, permitiendo que el sonido atraviese el resto de la banda. Los tamaños disponibles y el rango de ajuste permiten que el tambor tenga un buen rendimiento en una variedad de estilos, desde Funk hasta Hard Rock.',7,1,10),(40,'Pedal de Efecto Vox - Wah Wah - V847',567,43871,'https://d26lpennugtm8s.cloudfront.net/stores/001/166/603/products/vox-8471-c22a86963af59399ab15959459789228-640-0.jpg','- Conectores de entrada / salida: jack INST, jack AMP, DC i / p jack. - Fuente de alimentación: Una pila de 9 DC 6F22 (S-006P) - Consumo de energía: 540uA @ 9VCC - Duración de la batería para un uso continuo: aproximadamente> 100 horas con batería de manganeso (variará -dependiendo de las condiciones) - Dimensiones: 102 (W) x 252 (D) x 75 (H) (incluyendo patas de goma, pedal en la posición el más bajo)',4,2,33),(41,'Bateria Acustica Mapex - Prodigy - 5 Cuerpos + Fierros + Platos',4189,75,'https://d26lpennugtm8s.cloudfront.net/stores/001/166/603/products/mapex-prodigy1-c8fad3f5fec439a2c1158868804414011-7ff17fd63d64d8a97715896655793059-640-0.jpg','- Mapex da acceso al mundo de la batería con una gran calidad y estilo. - Producido en tilo con acabado recubierto, los tambores están equipados con Prodigy el nuevo modelo que utiliza un solo punto de contacto.',10,1,10),(42,'Cello Stradella - 1/2 - Studio - Con arco y Funda',1,18,'https://d26lpennugtm8s.cloudfront.net/stores/001/166/603/products/cello-stradella-1-21-6f087028ce1ed66f29158938039534061-766c81d0da99b089fa15897499931661-640-0.jpg','Descipcion',11,2,34);
